import React from "react";

function Stats(props) {
  let wins = props.info.wins;
  let gamesPlayed = props.info.gamesPlayed;
  let winPcent = (wins / gamesPlayed) * 100;
  let kills = props.info.kills;
  let deaths = props.info.deaths;
  let rounded = kills / deaths;
  return (
    <div className="container">
      <div className="row justify-content-md-center">
        <h1 className="m2">stats</h1>
        <div className="col-md-auto">
          <p>Your wins are: {props.info.wins}</p>
        </div>
        <div className="col-md-auto">
          <p>games played: {props.info.gamesPlayed}</p>
        </div>
        <div className="col-md-auto">
          <p>Your win percentage is: {winPcent.toFixed(2)}%</p>
        </div>
        <p>Top Fives: {props.info.topFive}</p>
        <p>Top Tens: {props.info.topTen}</p>
        <p>Top Twenty Fives: {props.info.topTwentyFive}</p>
        <p>Kill/Death Ratio: {rounded.toFixed(2)}</p>
        <p>Downs: {props.info.downs}</p>
        <p>Kills: {props.info.kills}</p>
        <p>Deaths: {props.info.deaths}</p>
        <p>Revives: {props.info.revives}</p>
        <p>Score: {props.info.score}</p>
      </div>
    </div>
  );
}

export default Stats;
